import ActionTypes from "../Actions/ActionTypes";

const initialState = {
    files: "data:image/png;base64,",
}

const MediaRepoReducer = (state = initialState , action) => {
    switch (action.type) {
        case ActionTypes.RECEIVED_RESPONSE:
            return {...state, isLoaded: true};

        case ActionTypes.FILE:
            return{state, files: action.payload.newValue}

        default:
            return state;
    }
}

export default MediaRepoReducer
